BEGIN TRANSACTION

SELECT
	UniqueIsoClamNumber.I_ALLCLM
	INTO #TestDate
FROM
	(
		SELECT
			clt1.I_ALLCLM,
			ROW_NUMBER() OVER(
				PARTITION BY
					clt1.I_ALLCLM
				ORDER BY
					clt1.Date_Insert DESC
			) uniqueInstanceValue
		FROM
			[ClaimSearch_Prod].[dbo].[CLT00001]clt1   
			INNER JOIN [ClaimSearch_Prod].[dbo].[CLT00014]clt14 
				ON clt1.I_ALLCLM = clt14.I_ALLCLM
				AND clt1.Date_Insert = clt14.Date_Insert
	) AS UniqueIsoClamNumber
WHERE
	UniqueIsoClamNumber.uniqueInstanceValue = 1


SELECT
	UniqueIsoClamNumber.I_ALLCLM
	INTO #TestNoDate
FROM
	(
		SELECT
			clt1.I_ALLCLM,
			ROW_NUMBER() OVER(
				PARTITION BY
					clt1.I_ALLCLM
				ORDER BY
					clt1.Date_Insert DESC
			) uniqueInstanceValue
		FROM
			[ClaimSearch_Prod].[dbo].[CLT00001]clt1   
			INNER JOIN [ClaimSearch_Prod].[dbo].[CLT00014]clt14 
				ON clt1.I_ALLCLM = clt14.I_ALLCLM
	) AS UniqueIsoClamNumber
WHERE
	UniqueIsoClamNumber.uniqueInstanceValue = 1


--501,000,740
--501,507,967
SELECT
	#TestNoDate.I_ALLCLM
FROM
	#TestNoDate
EXCEPT
SELECT
	#TestDate.I_ALLCLM
FROM
	#TestDate
